import React from 'react';
import { Link } from 'react-router-dom';

const NavbarComponent = () => {
  return (
    <ul>
    <Link to="/" class="list">
      Home
    </Link>
    <Link to="/about" class="list">
      about
    </Link>
    <Link to="/product" class="list">
     Product
    </Link>
    <Link to="/contact" class="list">
      Contact
    </Link>
  </ul>
  );
};

export default NavbarComponent;
